import * as React from 'react';
import { useState, useEffect } from 'react';
import { SearchBar } from '../SearchBar';
import { MessageList } from '../MessageList';
import { FilterButton } from '../FilterButton';
import { ConversationView } from '../ConversationView';
import type { Conversation } from '../../types/conversation';
import { Dashboard } from '../Dashboard';
import { ProfileUpload } from '../ProfileUpload';

interface MessageStats {
  totalMessages: number;
  highPriority: number;
  pendingReplies: number;
}

interface InboxProps {
  // ... existing props
}

const styles = `
.profile-button {
  width: 32px;
  height: 32px;
  padding: 0;
  border: none;
  background: none;
  cursor: pointer;
  border-radius: 50%;
  overflow: hidden;
  display: flex;
  align-items: center;
  justify-content: center;
}

.profile-button img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}

.profile-icon {
  font-size: 1.2rem;
}
`;

export const Inbox: React.FC<InboxProps> = ({ /* ... props */ }) => {
  const [activeTab, setActiveTab] = React.useState('inbox');
  const [selectedConversation, setSelectedConversation] = React.useState<Conversation | null>(null);
  const [messageStats, setMessageStats] = React.useState<MessageStats>({
    totalMessages: 5,
    highPriority: 3,
    pendingReplies: 3
  });
  const [searchTerm, setSearchTerm] = useState('');
  const [isProfileModalOpen, setIsProfileModalOpen] = useState(false);
  const [profileImage, setProfileImage] = useState<string | null>(null);

  // Load profile image on component mount
  useEffect(() => {
    const savedImage = localStorage.getItem('profileImage');
    if (savedImage) {
      setProfileImage(savedImage);
    }
  }, []);

  const handleTabClick = (tab: string) => {
    setActiveTab(tab);
  };

  const handleSearch = (term: string) => {
    setSearchTerm(term);
  };

  return (
    <div className="app-container">
      {/* Header */}
      <header className="app-header">
        <div className="header-left">
          <button className="menu-button">
            <span className="menu-icon">â˜°</span>
          </button>
          <h1 className="app-title">DailyFix N</h1>
        </div>
        <div className="header-right">
          <button className="refresh-button">
            <span role="img" aria-label="refresh">ðŸ”„</span>
          </button>
          <button className="notifications-button">
            <span role="img" aria-label="notifications">ðŸ””</span>
          </button>
          <button 
            className="profile-button"
            onClick={() => setIsProfileModalOpen(!isProfileModalOpen)}
          >
            {profileImage ? (
              <img 
                src={profileImage} 
                alt="Profile" 
                style={{ 
                  width: '32px', 
                  height: '32px', 
                  borderRadius: '50%',
                  objectFit: 'cover' 
                }} 
              />
            ) : (
              <span className="profile-icon">ðŸ‘¤</span>
            )}
          </button>
          {isProfileModalOpen && (
            <ProfileUpload onClose={() => setIsProfileModalOpen(false)} />
          )}
        </div>
      </header>

      {/* Navigation */}
      <nav className="app-nav">
        <button 
          onClick={() => handleTabClick('inbox')}
          className={`nav-link ${activeTab === 'inbox' ? 'active' : ''}`}
        >
          Inbox
        </button>
        <button 
          onClick={() => handleTabClick('dashboard')}
          className={`nav-link ${activeTab === 'dashboard' ? 'active' : ''}`}
        >
          Dashboard
        </button>
      </nav>

      {/* Main Content */}
      <main className="main-content">
        {activeTab === 'inbox' ? (
          <>
            <div className="inbox-container">
              <div className="inbox-header">
              <h2>Messages</h2>
                <FilterButton />
              </div>

              <SearchBar onSearch={handleSearch} />
              <MessageList 
                searchTerm={searchTerm}
                onConversationSelect={setSelectedConversation}
                onStatsUpdate={setMessageStats}
              />
            </div>
            <ConversationView conversation={selectedConversation} />
          </>
        ) : (
          <Dashboard stats={messageStats} />
        )}
      </main>
    </div>
  );
};
